  //     height: '100%',
  //   }}
  // >
  //   teste
  // </div>

  <>
    <div
      style={{
        position: 'fixed',
        minHeight: '100%',
        minWidth: '100%',
        objectFit: 'cover',
        zIndex: 1,
        mixBlendMode: 'hard-light',
        background: 'linear-gradient(180deg, #696969 -100%, #000 100%)',
      }}
    />

    <div className="first-div">
      <S.AuthPageContainer>
        <Grid container style={{ height: '100%', padding: 0 }}>
          <Grid item xs={12} md={8} sm={6}>
            {/* <SigninBanner /> */}
          </Grid>
          <Grid item xs={12} md={4} sm={6}>
            <div
              style={{
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
                alignItems: 'center',
                height: '100%',
              }}
            >
              <div
                style={{
                  // background: `url(${LOGO_IMG}) no-repeat center center`,
                  backgroundSize: 'contain',
                  height: 200,
                  marginBottom: 20,
                  width: '85%',
                }}
              />
              <div
                style={{
                  height: '100%',
                  width: '100%',
                }}
              >
                <div className="content">
                  {/* <img src={logo2} alt="" /> */}
                  <SigninForm />
                </div>
              </div>
            </div>
          </Grid>
        </Grid>
      </S.AuthPageContainer>
    </div>
  </>
);

export default SigninPage;
